const result=document.getElementById("datecalc_result"),timerResult=document.getElementById("timer_result");export const printError=(e,t)=>{"datecalc"==t.target.id?result.innerText=e:timerResult.innerText=e};export const printResultDate=({years:e,months:t,weeks:r,days:s,hours:n,minutes:i,seconds:m},u)=>{if("datecalc"==u.target.id)result.innerHTML=`Год: ${e} - Месяц: ${t} - День: ${s}`;else if("datetimer"==u.target.id)return timerResult.innerHTML=`Год: ${e} - Месяц: ${t} - Недель ${r}  - День: ${s} - Час - ${n} - Минуты ${i} - Секунды ${m}`,[{years:e,months:t,weeks:r,days:s,hours:n,minutes:i,seconds:m},timerResult]};